package city.model.dao.entidades.extras;

public class Sangre {

	private String san_genero;

	private String san_tipo;

	private Integer san_cantidad;
	
	public Sangre() {
		// TODO Auto-generated constructor stub
	}

	public String getSan_genero() {
		return san_genero;
	}

	public void setSan_genero(String san_genero) {
		this.san_genero = san_genero;
	}

	public String getSan_tipo() {
		return san_tipo;
	}

	public void setSan_tipo(String san_tipo) {
		this.san_tipo = san_tipo;
	}

	public Integer getSan_cantidad() {
		return san_cantidad;
	}

	public void setSan_cantidad(Integer san_cantidad) {
		this.san_cantidad = san_cantidad;
	}

}
